import axios from 'axios';
import '../CSS/Style.css';
import {Link, useParams } from 'react-router-dom';

function Cart() {

const {id}= useParams();

const[product,setProduct]=useState([]);

useEffect(()=>{
    axios.get(`https://fakestoreapi.com/carts/5`)
    .then((response)=>{
        console.log(response.data);
        setProduct(response.data);
    });
},[])

return(
    <>

    {
      product && product.length>0 && apidata.map((products)=>{
        console.log(products);

        return(
          <>
            <div className='product'>
           <div className='cards'>

           <Link to={`/${products.id}`}>
            <img src={products?.image} alt='image' className='images'></img></Link>
           <p>{products.title}</p>
           <p>Rs : {products.price}</p>
           <button className='button' onClick={()=>handleclick(products)} handleclick={handleclick}>ADD TO CART</button>
           </div>
           </div>
          </>
        )
      })
    }

  </>

)

}

export default Cart;
